def get_img(base64_str, img_name):
    img_path = os.path.abspath(os.path.dirname(__file__))
    if not os.path.exists(img_path):
        os.makedirs(img_path)
    imgpath = os.path.join(img_path, f'{img_name}.jpg')
    # img_str = 'data:image/png;base64,'
    if 'data:image/png;base64' in base64_str:
        base64_str = re.sub('^data:image/.+;base64,', '', base64_str)
    byte_data = base64.b64decode(base64_str)
    image_data = BytesIO(byte_data)
    img = Image.open(image_data).convert('RGB') #RGBA转化为RGB
    img.save(imgpath)
    return imgpath
    # img.write(image_data)
    # img.show()


def get_distance(target, template):
    tar_rgb = cv2.imread(target, 0)
    tem_rgb = cv2.imread(template, 0)
    tar_gray = cv2.cvtColor(tar_rgb, cv2.COLOR_BayerGR2GRAY)
    res = cv2.matchTemplate(tar_gray, tem_rgb, cv2.TM_CCOEFF_NORMED)
    values = cv2.minMaxLoc(res)
    print(values)





